func findMinimumOperations(s1 string, s2 string, s3 string) int {
    // The strategy is to check from the end of the strings, reducing them step by step.
    // The minimum number of operations is determined by the sum of the differences in length
    // after aligning their rightmost equal characters.

    // First, we find the shortest string since it limits how far back we can potentially make them equal.
    minLen := len(s1)
    if len(s2) < minLen {
        minLen = len(s2)
    }
    if len(s3) < minLen {
        minLen = len(s3)
    }

    // We attempt to align the strings from their rightmost characters.
    // If at any point, the characters don't match, it's impossible to make them equal by deleting characters.
    for i := 0; i < minLen; i++ {
        if s1[len(s1)-1-i] != s2[len(s2)-1-i] || s2[len(s2)-1-i] != s3[len(s3)-1-i] {
            return -1
        }
    }

    // Calculate the number of deletions needed based on the difference in lengths.
    // Since we need to make them equal, we consider the total number of deletions needed to reach the length of the shortest string.
    return len(s1) - minLen + len(s2) - minLen + len(s3) - minLen
}
